import React from "react";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>직업 가치관 검사</p>
      </header>
      <label>
        {" "}
        이름:
        <input type="text" name="name" />
      </label>
      asdf
      <label>
        <input
          type="radio"
          name="radioGroup"
          value="react"
          checked={this.state.radioGroup["react"]}
          onChange={this.handleRadio}
        />
        React
      </label>
      <br />
      <label>
        <input
          type="radio"
          name="radioGroup"
          value="polymer"
          checked={this.state.radioGroup["polymer"]}
          onChange={this.handleRadio}
        />
        Polymer
      </label>
    </div>
  );
}

export default App;
